/* defaults */
h1, h2, h3, h4, h5, h6 {margin: 0; font-size: 12px; font-weight: normal; text-shadow:1px 1px #fff;}
article, aside, details, figcaption, figure, footer, header, hgroup, menu, nav, section { display: block; } /*  HTML 5 elements  */
.cf:before, .cf:after {content:"";display:table;}
.cf:after {clear:both;}
.cf {zoom:1;}
a {color:#666;}
a:hover {color:#000;}
a img {border:0px;}
a:active, visited {outline:none;}
form {padding:0px; margin:0px;}
p {margin-top: 0px;}
p:last-child { margin-bottom:0;}
html, body, form {margin: 0; padding: 0;}
input {outline: none 0;}
.no-mr {margin-right:0px}

body {font-family:Arial, Helvetica, sans-serif; font-size:11px; background:#e5e5e5}
#m-container {width:100%; overflow:hidden}

/* header */
#m-header {background:#026AC2 url(/ekmps/designs/assets/master/1213/images/header-bg.png) repeat-x bottom; min-height:60px; overflow:hidden}
#m-logo {
    display: block;
    margin: 18px 0 18px 4px;
    font-size: 19px;
    font-weight: bold;
    color: white;
    text-shadow: 1px 1px black;
    overflow: hidden; 
    text-decoration:none;
}

/* cart */
#m-cart {float: right;min-width: 59px; background:#666 url(/ekmps/designs/assets/master/1213/images/cart-button.jpg);border-radius: 5px;margin:16px 6px 16px 0;text-decoration: none;font-size: 14px;font-weight: bold;color: #555;text-align: left;text-shadow: 1px 1px white;padding:6px 3px;text-align: center; }
#m-cart:hover {background:#ccc;}

/* search */
#m-search {background:url(/ekmps/designs/assets/master/1213/images/search-bg.jpg) repeat-x; position:relative; padding:5px; margin:0; border-bottom:1px solid #ccc;}
#m-search-box {width:100%; border: 1px solid #CCC;border-radius: 3px;padding:7px 6px; color:#777; -webkit-box-sizing: border-box;-moz-box-sizing: border-box;-ms-box-sizing: border-box;-o-box-sizing: border-box;box-sizing: border-box;}
#m-search-button {position: absolute;right: 14px;top: 14px; opacity:0.7; width:17px; height:17px;}

/* nav */
#m-nav {background:#999 url(/ekmps/designs/assets/master/1213/images/nav-bg.jpg) repeat-x; height:45px; width:100%; float:left;}

#m-nav #m-home-icon {float: left; margin-left: -100%; margin-top: 13px; width: 39px;}
#m-nav #m-home {margin-left: 10px;}
#m-nav #m-home:hover {opacity:0.7}

#m-nav #m-jump-wrapper {float: left;width: 100%;}
#m-nav #m-jump-content {margin-left: 35px;margin-top: -1px;overflow: hidden;padding: 7px; }
#m-nav #box1 {
    float: left;
    padding: 6px;
    border: 1px solid #CCC;
    border-radius: 3px;
    width:100%;
    height: 31px;
    background:#fff;
    color:#777;
    font-size:12px;
}

/* content */
#m-shop-content {background:#E7E7E7; min-height:150px; clear:both;}

/* page header */
#m-page-header {
	background:#000 url(/ekmps/designs/assets/master/1213/images/page-title-bg.jpg) repeat-x; 
	text-align:left;
	color: #FFFFFF;
	float: left;
	font-size: 14px;
	font-weight: bold;
	margin: 0;
	padding: 10px;
	text-align: left;
	text-shadow: 1px 1px #000;
	width: 100%; 
	clear:both; 
	-webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    -ms-box-sizing: border-box;
    -o-box-sizing: border-box;
    box-sizing: border-box;
}
	
.products-container {overflow:hidden; clear:both;}

/* footer */
#m-footer-info {background:#333 url(/ekmps/designs/assets/master/1213/images/footer-info-bg.jpg) repeat-x; color: #CCC; text-align: center; text-shadow: 1px 1px #333; padding:18px 4px}
#m-footer-info a {margin-left:10px; color:#fff;}
#m-footer-info a:hover {color:#ccc}
#m-footer {background:#000; text-align:center; color:#ccc; padding:20px 4px}
#m-footer a {color:#ccc;}
#m-footer a:hover {color:#fff;}
#m-powered {padding: 10px 0;text-align: center;}

