var $j = jQuery;

function centreDiv(c){
    $j(c).each(function(){
        var element = $j(this);

        var innerHeight = element.innerHeight();

        var left = element.find('#leftcolumn,.leftcolumn').eq(0);

        var leftHeight = left.height();

        var leftTop = Math.floor((innerHeight - leftHeight) / 2);
        left.css('marginTop', leftTop + 'px');


        var content = element.find('#contentcolumn,.contentcolumn').eq(0);

        var contentHeight = 0;
        content.children().each(function(){
            var element = jQuery(this);
            contentHeight = contentHeight + element.outerHeight(true);
        });

        var contentTop = Math.floor((innerHeight - contentHeight) / 2);
        content.children().eq(0).css('marginTop', contentTop + 'px');


        var qty = element.find('.product-item-qty');

        if (qty.length == 0){
            return;
        }

        var qtyHeight = qty.height();
        var qtyTop = Math.floor((innerHeight - qtyHeight) / 2);
        qty.css('marginTop', qtyTop + 'px');
	});	
}

$j(window).bind('load', function(){
	centreDiv('.item');
});

jQuery(function(){
    jQuery('.item-image:has(img)').each(function(){
        jQuery(this).css('background', '#fff');
    });
});

jQuery(window).bind('load', function(){
    var imgs = jQuery('.item-image>span>a>img, .item-image>a>img, .item-image>img');

    imgs.each(function(){
        var img = jQuery(this);
        var parent = img.parent();

        var imgHeight = img.height();
        var parentHeight = parent.height();

        var marginTop = Math.floor((parentHeight - imgHeight) / 2);

        if (marginTop < 1){
            return;
        }

        img.css('marginTop', marginTop + 'px');
    });
});

